import react, { useState, useEffect } from 'react';
import { getAllCharacters } from '../services/getAllCharacters';

export default function List() {
  const [characters, setCharacters] = useState([]);

  useEffect(() => {
    getAllCharacters()
      .then((data) => {
        setCharacters(data.results);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

  return (
    <>
      <ul>
        {characters
          ? characters.map((char) => {
              <li>{char.name}</li>;
            })
          : null}
      </ul>
    </>
  );
}
